const unsigned int songLen = 40310;

// Sweeden      1 -> Index  0
// DryHands     2 -> Index  322
// Pokemon      3 -> Index  1119
// Sweet Cgild  4 -> Index  7741
// N in Paris   5 -> Index  9225
// Cat          6 -> Index  9354
// Mario        7 -> Index  27483
// Snowman      8 -> Index  31732
// Mocking Bird 9 -> Index  34573
// I Wonder     0 -> index  39131

void songPlayer(void)
{
    if (!songPlaying || song_done)
        return;

    while (songIndex < songLen && tim7Ticks >= next_tick)
    {
        uint8_t b = song[songIndex++];

        if (b & 0x80)
        {
            uint8_t cmd = b & 0xF0;

            switch (cmd)
            {
            case 0x90:
            { // Note On
                uint8_t note = song[songIndex++];
                sendMIDI(SONGPLAYER_CHANNEL, note, songPlayer_volume);
                break;
            }
            case 0x80:
            { // Note Off
                // aaaa do nothing
                break;
            }
            case 0xF0: // End of song
                song_done = 1;
                allNotesOff(0);
                // Move to next song and start it
                skipToNextSong();
                return;

            default:
                break;
            }
        }
        else
        {
            if (songIndex >= songLen)
                break;
            uint16_t delay = ((b & 0x7F) << 8) | song[songIndex++];
            next_tick = tim7Ticks + delay;
            break;
        }
    }
}

void skipToNextSong(void)
{
    currentSong++;
    if (currentSong > '9')
        currentSong = '0';
    // restart playback of the new song
    startSong();
}

void playsongFromKey(char c)
{
    currentSong = c;
    startSong();
}

void startSong(void)
{
    tim7Ticks = 0;
    songIndex = getSongIndexFromChar(currentSong);
    next_tick = 0;
    song_done = 0;
    songPlaying = 1;

    TIM7->SR &= ~TIM_SR_UIF;
    TIM7->CR1 |= TIM_CR1_CEN;
}

void stopSong(void)
{
    TIM7->CR1 &= ~TIM_CR1_CEN;

    for (uint8_t ch = 0; ch < 16; ch++)
    {
        allNotesOff(ch);
    }

    songPlaying = 0;
    song_done = 1;
}

void pauseSong(void)
{
    TIM7->CR1 &= ~TIM_CR1_CEN;
    songPlaying = 0;
}

void resumeSong(void)
{
    TIM7->SR &= ~TIM_SR_UIF;
    TIM7->CR1 |= TIM_CR1_CEN;
    songPlaying = 1;
}

uint32_t getSongIndexFromChar(char c)
{
    switch (c)
    {
    case Sweeden:
        return SweedenIdx;
    case Dry:
        return DryIdx;
    case Poke:
        return PokeIdx;
    case Sweet:
        return SweetIdx;
    case Nnn:
        return NnnIdx;
    case Cat:
        return CatIdx;
    case Mario:
        return MarioIdx;
    case Snowman:
        return SnowmanIdx;
    case Mocking:
        return MockingIdx;
    case Wonder:
        return WonderIdx;
    default:
        return SweedenIdx; // fallback
    }
}